						<div itemprop="articleBody">
		<p style="text-align: center;"><strong>Indkaldelse til Årsmøde i Danske Kvindelige Lægers Forening</strong></p>
<p style="text-align: center;"><strong>Tirsdag d. 30 april 2013&nbsp;Kl. 16.00</strong></p>
<p style="text-align: center;"><strong>Lille Auditorium, Gentofte Hospital Niels Andersens vej 65, 2900 Hellerup</strong></p>
<p>1. Velkomst v. Birte Holm Sørensen</p>
<p>2. Uddeling af Agnethe Løvgreens Legat v. Kirsten Salado-Rasmussen</p>
<p>3. Indlæg af årets legatmodtagere, som kort vil præsentere deres projekter.</p>
<p>4. Orientering om foreningens større aktiviteter:</p>
<ul>
<li>IMWA Nordeuropæiske Regions Møde i Danmark 2014 v. Margit Niebuhr</li>
<li>Myanmar Projektet v. Birte Holm Sørensen</li>
<li>Mentorordningen v. Maria Lippa</li>
</ul>
<p>Efterfølgende vil der være et let traktement, inden der afholdes Generalforsamling kl. 19.</p>
<p>På bestyrelsens vegne</p>
<p>Birte Holm Sørensen</p>	</div>

	
